                  <Form.Field>
                      <label>Color</label>
                      <input placeholder='#4285F4' onChange={this.handleChange}/>
                  </Form.Field>
                  <Button onClick={postData} type='submit'>Submit</Button>
              </Form>
          </div>
        </div>

    )
}
}
